import React from "react";
import './style.css'
function Signup() {
  return (
    <div className='content-holder'>
    <div className='page-header'>JOIN US</div>
    <hr className='break-line'/>
    <form className='input-form'>
      <input className='text-input'  type='text' placeholder='user@email.com'></input>
      <input className='text-input' type='password' placeholder='password'></input>
      <input className='text-input' type='password' placeholder=' confirm password'></input>
      <button className='submit-btn' type='submit'>SIGNUP</button>
    </form>
  </div>
  );
}

export default Signup;
